    <!--need to consume jquery -->
   
  <script>
      
        $(document).ready(function(){
            
            //resume nav stuff
            var resume = $('.resume');
            var goToTop = $('#gototop');
            
            //nav for clicking and highlting an item, scrolls to the newly clicked items height and hides the rest
            $('.nav').click(function(){
                var el = $(this).attr('class').split(' ')[0];
                if($(this).attr('id')==='current'){
                    return false;
                }else{
                    $('.nav').removeAttr('id');
                    $(this).attr('id','current');
                    $('.show').hide();
                    $('.resume').scrollTop(0);
                    $('#'+el).fadeIn(500);
                    goToTop.css('opacity','0');
                    $('#gototop a').css("cursor","default");
                    goToTop.unbind('click');
                }
            });
            
            //prevents the resume top arrow becoming a link
            $('.resume a').click(function(e){
                e.preventDefault();
            });  
            
            //shows and hide scroll to top arrow
            resume.scroll(function() {
                goToTop.toggleClass('on', resume.scrollTop() >= 200);
                if(resume.scrollTop() >=200){
                    goToTop.stop().animate({opacity:1},300);
                    $('#gototop a').css("cursor","pointer");
                    goToTop.bind('click',function(){
                        $('.resume').stop().animate({scrollTop: 0}, 1200);   
                    });
                }else{
                    goToTop.stop().animate({opacity:0},300);
                    $('#gototop a').css("cursor","default");
                    goToTop.unbind('click');
                }
            });

            //scroll to for the images(piece county logo etc)
            $('.imageClick img').click(function() {
                var el = $(this).parent().attr('name');
                scrollToDiv(el);
                return false;
            });
            
            
            //svg pie graph get text and scroll to it.
            $('path').click(function() {
                var el = $(this).next("text").children('tspan').text();
                el = jqSelector(el);
                
                scrollToDiv(el);
                return false;
            });
            
            // Escapes special characters and returns a valid jQuery selector
            function jqSelector(str)
            {
                return str.replace(/([;&,\.\+\*\~':"\!\^#$%@\[\]\(\)=>\|])/g, '\\$1');
            }
            
            //scrolls to the element with the id thats passed in.
            function scrollToDiv(element){
                
                var offset = $('#'+element).offset();
                var cont = $("#resumeContainer").offset();
                var offsetTop = offset.top-cont.top-15;
                
                $('.resume').animate({scrollTop: offsetTop}, 1200);
                
            };
            
        });
        
        
        
        
  </script>
  